import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowRight } from '@fortawesome/free-solid-svg-icons/faArrowRight';
import Button from './button';
import { faAdd } from '@fortawesome/free-solid-svg-icons';
import Table from './table';
import "../styles/create.css"

const Create = () => {
  return (
    <div className='create'>
      <div className='create-nav'>
        <div className='title'>Create Invoice</div>
        <Button text={"Save as Draft"} />
        <Button text={"Save and Print"} />
        <Button text={"Save"} icon={<FontAwesomeIcon icon={faArrowRight} />} />
      </div>
      <div className='create-body'>
        <Button text={"Add new Invoice"} icon={<FontAwesomeIcon icon={faAdd} />} />
        <Table />
      </div>
    </div>
  )
}

export default Create
